import axios from "axios";

export const useFetch = (url) => async dispatch => {
    console.log(url);
    try{
        const res = await axios.get(`${url}`);
        return res;
        // dispatch(loadNeeds(allNeedsRes.data));
    }catch(e){
        return console.error(e.message);
    }
}
